import React, { useState, useEffect } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TableSortLabel,
  TablePagination,
} from '@mui/material';
import '../styles/DataTable.css';

const DataTable = ({ data }) => {
  const [order, setOrder] = useState('asc');
  const [orderBy, setOrderBy] = useState('');
  const [currentPage, setCurrentPage] = useState(0); // Adjusted for 0-based indexing
  const rowsPerPage = 10; // Number of records per page
  const [sortedColumn, setSortedColumn] = useState('');

  useEffect(() => {
    // Ensure default data display on page load
    setOrder('asc');
    setOrderBy('');
    setSortedColumn('');
  }, [data]);

  const handleSort = (column) => {
    const isAsc = orderBy === column && order === 'asc';
    setOrder(isAsc ? 'desc' : 'asc');
    setOrderBy(column);
    setSortedColumn(column);

    // Sort data based on the column and order
    data.sort((a, b) => {
      if (isAsc) {
        return a[column] < b[column] ? -1 : 1;
      } else {
        return a[column] > b[column] ? -1 : 1;
      }
    });
  };

  // Calculate records to display for the current page
  const startIndex = currentPage * rowsPerPage;
  const endIndex = startIndex + rowsPerPage;
  const paginatedData = data.slice(startIndex, endIndex);

  const handlePageChange = (event, page) => {
    setCurrentPage(page);
  };

  return (
    <TableContainer component={Paper} className="data-table-container">
      <Table>
        {/* Table Headers */}
        <TableHead>
          <TableRow>
            <TableCell className="table-header">
              <TableSortLabel
                active={orderBy === 'paytype_id'}
                direction={orderBy === 'paytype_id' ? order : 'asc'}
                onClick={() => handleSort('paytype_id')}
              >
                Pay Type ID
              </TableSortLabel>
            </TableCell>
            <TableCell align="center" className="table-header">
              <TableSortLabel
                active={orderBy === 'amount'}
                direction={orderBy === 'amount' ? order : 'asc'}
                onClick={() => handleSort('amount')}
              >
                Amount
              </TableSortLabel>
            </TableCell>
            <TableCell align="center" className="table-header">
              <TableSortLabel
                active={orderBy === 'date'}
                direction={orderBy === 'date' ? order : 'asc'}
                onClick={() => handleSort('date')}
              >
                Date
              </TableSortLabel>
            </TableCell>
            <TableCell align="center" className="table-header">
              <TableSortLabel
                active={orderBy === 'provider_id'}
                direction={orderBy === 'provider_id' ? order : 'asc'}
                onClick={() => handleSort('provider_id')}
              >
                Provider ID
              </TableSortLabel>
            </TableCell>
            <TableCell align="center" className="table-header">
              <TableSortLabel
                active={orderBy === 'employee_type_id'}
                direction={orderBy === 'employee_type_id' ? order : 'asc'}
                onClick={() => handleSort('employee_type_id')}
              >
                Employee Type ID
              </TableSortLabel>
            </TableCell>
          </TableRow>
        </TableHead>

        {/* Table Body */}
        <TableBody>
          {paginatedData.map((row, index) => (
            <TableRow key={index}>
              <TableCell
                align="center"
                className={`table-cell ${sortedColumn === 'paytype_id' ? 'sorted-column' : ''}`}
              >
                {row.paytype_id}
              </TableCell>
              <TableCell
                align="center"
                className={`table-cell ${sortedColumn === 'amount' ? 'sorted-column' : ''}`}
              >
                {row.amount}
              </TableCell>
              <TableCell
                align="center"
                className={`table-cell ${sortedColumn === 'date' ? 'sorted-column' : ''}`}
              >
                {row.date}
              </TableCell>
              <TableCell
                align="center"
                className={`table-cell ${sortedColumn === 'provider_id' ? 'sorted-column' : ''}`}
              >
                {row.provider_id}
              </TableCell>
              <TableCell
                align="center"
                className={`table-cell ${sortedColumn === 'employee_type_id' ? 'sorted-column' : ''}`}
              >
                {row.employee_type_id}
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>

      {/* Pagination Controls */}
      <TablePagination
        component="div"
        count={data.length}
        page={currentPage}
        onPageChange={(event, newPage) => handlePageChange(event, newPage)}
        rowsPerPage={rowsPerPage}
        rowsPerPageOptions={[10]} // Only allow 10 rows per page
      />
    </TableContainer>
  );
};

export default DataTable;
